/banner-1544x500.png\"},\"expires\":\"\",\"code\":\"\",\"date\":\"\",\"type\":\"free\"},\"20813244\":{\"title\":\"GetResponse\",\"name\":\"GetResponse\",\"slug\":\"getresponse-wordpress-plugin\",\"version\":\"1.04\",\"new_version\":\"1.04\",\"location\":[\"fp.strategy11.com\\/releases\\/getresponse\\/formidable-getresponse-1.04.zip\"],\"excerpt\":\"Collect leads in WordPress forms and automatically add them in GetResponse. Then trigger automatic emails and other GetResponse marketing automations.\",\"id\":20813244,\"released\":\"2018-09-06 00:00:00\",\"categories\":[\"Business\",\"Marketing\"],\"docs\":\"https:\\/\\/formidableforms.com\\/knowledgebase\\/getresponse-forms\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/getresponse-wordpress-plugin\\/\",\"changelog\":\"<h4>v1.04 - October 2, 2019<\\/h4>\\n<ul>\\n<li>Allow 0 for the cycle start day<\\/li>\\n<li>Show more helpful messages in the form action if the GetResponse lists cannot be fetched<\\/li>\\n<li>Update the form action icon for 4.0<\\/li>\\n<li>Remove the debug mode option and use the Logging plugin instead<\\/li>\\n<li>Load all custom fields right away since they aren\'t different for each list. Also don\'t hide the custom fields when a list changes.<\\/li>\\n<li>Prevent error with Formidable disabled<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-getresponse\\/formidable-getresponse.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"expires\":\"\",\"code\":\"\",\"date\":\"\",\"type\":\"free\"},\"180495\":{\"title\":\"Highrise\",\"name\":\"Highrise\",\"slug\":\"highrise\",\"version\":\"1.06\",\"new_version\":\"1.06\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-highrise\\/formidable-highrise-1.06.zip\"],\"excerpt\":\"Capture leads in your WordPress contact forms, and sav