de in favor of logging<\\/li>\\n<li>Tweak: Clear the settings cache with a link instead of ajax for more reliable cache clearing<\\/li>\\n<li>Fix: Updating data in Salesforce wasn\'t working correctly<\\/li>\\n<li>Fix: There was an error when Formidable was disabled<\\/li>\\n<\\/ul>\\n<h4>v2.03 - October 11, 2018<\\/h4>\\n<ul>\\n<li>New: Add option to update Salesforce records<\\/li>\\n<li>New: Add support for Salesforce Boolean fields<\\/li>\\n<li>Fix: Multiselect picklist fields weren\'t getting correct values from a checkbox<\\/li>\\n<li>Fix: Date fields set as a post field were sending the wrong date format<\\/li>\\n<li>Fix: Fatal error caused by date fields in certain formats<\\/li>\\n<\\/ul>\\n<h4>v2.02 - June 14, 2018<\\/h4>\\n<ul>\\n<li>Add API calls to <a href=\\\"https:\\/\\/formidableforms.com\\/features\\/api-logs\\/\\\">Logs plugin<\\/a><\\/li>\\n<li>Add more messages for debugging<\\/li>\\n<li>Fix issue with authenticating on an SSL site<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-salesforce\\/formidable-salesforce.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"expires\":\"\",\"code\":\"\",\"date\":\"\",\"type\":\"free\"},\"163248\":{\"title\":\"Signature\",\"name\":\"Signature\",\"slug\":\"signature\",\"version\":\"2.03\",\"new_version\":\"2.03\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-signature\\/formidable-signature-2.03.zip\"],\"excerpt\":\"Add an electronic signature to your WordPress form. The visitor may write their signature with a trackpad\\/mouse or type it.\",\"id\":163248,\"released\":\"2013-03-04 00:00:00\",\"categories\":[\"Business\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-signature\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/signature\\/\",\"changelog\":\"<h4>v2.03 - September 24, 2019<\\/h4>\\n<ul>\\n<li>New: Make field labels translatable with WPML<\\/li>\\n<li>Switch back to frm font instead of Font Awesome to avoid conflicts and an external asset.<\\/li>\\n<li>Fix: Importing signatures in an entry wasn\'t working<\\/li>\\n<\\/ul>\\n<h4>v2.02 - January 30, 2019<\\/h4>\\n<ul>\\n<li>Fix: Show the signature correctly in views and emails when Pro is running<\\/li>\\n<\\/ul>\\n<h4>v2.01 - January 16, 2019<\\/h4>\\n<ul>\\n<li>New: Give the signature field a face lift and show the field in the builder<\\/li>\\n<li>New: Show the typed option by default when javascript fails instead of showing nothing<\\/li>\\n<li>New: Don\'t clear the typed box when switching tabs<\\/li>\\n<li>Fix: The signature wasn\'t showing correctly in an email<\\/li>\\n<li>Fix: The signature field wasn\'t appearing for in-place edit<\\/li>\\n<\\/ul>\\n<h4>v2.0 - January 14, 2019<\\/h4>\\n<ul>\\n<li>New: The signature value immediately creates the image when the signature is saved and saves the url of the image for easier display. On update, all previous signatures are updated to the new format saved in the database.<\\/li>\\n<li>New: Add signature support for ajax forms and repeating sections.<\\/li>\\n<li>New: Allow importing from URL and include signature URL in XML.<\\/li>\\n<li>New: Use the 3.0 field object for better forward compatibility and lower baseline memory.<\\/li>\\n<li>New: Requires Formidable 3.0+<\\/li>\\n<li>New: Combine scripts into one file, and don\'t load IE8 fallback script in all browsers.<\\/li>\\n<li>New: Keep drawn signature when switching pages and when there are form validation errors.<\\/li>\\n<li>New: Allow signature editing in single-page form until draft is submitted.<\\/li>\\n<li>Fix: Remove frm_email_value hook for newer versions of Formidable.<\\/li>\\n<li>Fix: Prevent error message when Formidable is disabled<\\/li>\\n<li>Fix: Show the signature image with https when needed<\\/li>\\n<li>Fix: The hide tabs options weren\'t saving since v3.0<\\/li>\\n<\\/ul>\\n<h4>v2.0b1 - December 7, 2017<\\/h4>\\n<ul>\\n<li>New: Add signature support with ajax forms and repeating sections<\\/li>\\n<li>New: Allow importing from URL and include signature URL in XML<\\/li>\\n<li>Fix: Keep drawn signature when switching pages.<\\/li>\\n<li>Fix: Keep drawn signature present when there are form errors.<\\/li>\\n<li>Fix: Allow signature editing until draft is submitted.<\\/li>\\n<li>Fix: Remove frm_email_value hook for newer versions of Formidable.<\\/li>\\n<li>Fix: Resolve error message when Formidable is disabled<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-signature\\/signature.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"expires\":\"\",\"code\":\"\",\"date\":\"\",\"type\":\"free\"},\"310430\":{\"title\":\"Stripe\",\"name\":\"Stripe\",\"slug\":\"stripe\",\"version\":\"2.02\",\"new_version\":\"2.02\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-stripe\\/formidable-stripe-2.02.zip\"],\"excerpt\":\"Any Formidable forms on your site can accept credit card payments without users ever leaving your site.\",\"id\":310430,\"released\":\"2016-04-26 00:00:00\",\"categories\":[\"Ecommerce\",\"Elite\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/stripe\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/stripe\\/\",\"changelog\":\"<h4>v2.02 - March 9, 2020<\\/h4>\\n<ul>\\n<li>Update the Stripe library.<\\/li>\\n<li>New: Include the first and last name on a newly created customer.<\\/li>\\n<li>Fix: If a payment attempt failed after the entry was created, the credit card field was hidden and couldn\'t be updated.<\\/li>\\n<li>Fix: The previous button on the same page as a credit card field wasn\'t doing anything.<\\/li>\\n<li>Fix: Payments weren\'t being collected correctly in Internet Explorer.<\\/li>\\n<li>Fix: The refund button was returning a \\\"Failed\\\" message with some payments.<\\/li>\\n<li>Fix: When the font-family setting included incorrect characters, the credit card field wasn\'t displayed.<\\/li>\\n<li>Fix: Some error messages were being bypassed like strong password and invisible recaptcha.<\\/li>\\n<\\/ul>\\n<h4>v2.01 - September 19, 2019<\\/h4>\\n<ul>\\n<li>New: Hide the Zip\\/Postal code. It\'s not a great user experience, and isn\'t necessary.<\\/li>\\n<li>Fix: Trigger database install or upgrade when activated site wide in WP multisite.<\\/li>\\n<li>Fix: Prevent a fatal error with undefined function on some sites.<\\/li>\\n<li>Fix: Prevent issues with a subsequent payment when customer is deleted in Stripe.<\\/li>\\n<\\/ul>\\n<h4>v2.0 - September 9, 2019<\\/h4>\\n<ul>\\n<li>New: Add support for SCA, Stripe elements, and Secure 3d Payments. More styling for the new credit card field is coming with Formidable v4.02.04.<\\/li>\\n<li>New: Set the locale for the credit card field and instant error messages.<\\/li>\\n<li>New: Add option in payment form actions to authorize one-time payments without capture.<\\/li>\\n<li>New: Include an option to process one-time payments before the entry is created.<\\/li>\\n<li>New: Add minified javascript.<\\/li>\\n<li>Reverse the order of private and public keys to match Stripe account page.<\\/li>\\n<li>Hide settings in credit card field in forms with Stripe including sub field descriptions, placeholders, and options to save card info. These are no longer used with the more secure credit card field.<\\/li>\\n<li>Switch to Stripe js v3<\\/li>\\n<li>Add Bangladeshi Taka currency<\\/li>\\n<li>Fix: some API versions were returning an error when canceling a subscription.<\\/li>\\n<li>Update form action icon<\\/li>\\n<li>Remove incorrect edit link for a subscription<\\/li>\\n<li>Fix error with wrong class name \\\"FrmTransSubscriptionsController\\\"<\\/li>\\n<li>Remove usage of deprecated FrmDb class<\\/li>\\n<\\/ul>\\n<h4>v2.0b2 - September 7, 2019<\\/h4>\\n<ul>\\n<li>Add option in payment form actions to authorize one-time payments without capture.<\\/li>\\n<li>Set the locale for the credit card field including error messages.<\\/li>\\n<li>Reverse the order of private and public keys to match Stripe account page.<\\/li>\\n<li>Hide settings in credit card field in forms with Stripe including sub field descriptions, placeholders, and options to save card info.<\\/li>\\n<li>Fix: Prevent 403 errors on return from Secure 3D approval by generating the success message on return.<\\/li>\\n<\\/ul>\\n<h4>v2.0b - September 2, 2019<\\/h4>\\n<ul>\\n<li>New: Add support for SCA, Stripe elements, and Secure 3d Payments.<\\/li>\\n<li>New: Include an option to process one-time payments before the entry is created.<\\/li>\\n<li>New: Add minified javascript.<\\/li>\\n<li>Switch to Stripe js v3.<\\/li>\\n<li>Add Bangladeshi Taka currency<\\/li>\\n<li>Fix: some API versions were returning an error when canceling a subscription.<\\/li>\\n<li>Update form action icon<\\/li>\\n<li>Remove incorrect edit link for a subscription<\\/li>\\n<li>Fix error with wrong class name \\\"FrmTransSubscriptionsController\\\"<\\/li>\\n<li>Remove usage of deprecated FrmDb class<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-stripe\\/formidable-stripe.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"expires\":\"\",\"code\":\"\",\"date\":\"\",\"type\":\"free\"},\"168460\":{\"title\":\"Twilio\",\"name\":\"Twilio\",\"slug\":\"twilio\",\"version\":\"1.08\",\"new_version\":\"1.08\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-twilio\\/formidable-twilio-1.08.zip\"],\"excerpt\":\"Allow users to text their votes for polls created by Formidable Forms, or send SMS notifications when entries are submitted or updated.\",\"id\":168460,\"released\":\"2014-03-10 00:00:00\",\"categories\":[\"Business\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/twilio-add-on\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/twilio\\/\",\"changelog\":\"<h4>v1.08 - January 16, 2017<\\/h4>\\n<ul>\\n<li>Improved: Removed deprecated instructions and screenshot.<\\/li>\\n<li>Improved: Removed deprecated valign attribute from table HTML.<\\/li>\\n<\\/ul>\\n<h4>v1.07 - November 1, 2016<\\/h4>\\n<ul>\\n<li>When an SMS message is received, run validation and respond with a text that includes any error messages<\\/li>\\n<li>When a text is received successfully, respond with the form success message, filtered list like a form does.<\\/li>\\n<li>Allow for the \\\"other\\\" fields to be filled from a text submission<\\/li>\\n<li>Check if license number is for correct plugin<\\/li>\\n<li>Don\'t try to send messages to a blank number<\\/li>\\n<\\/ul>\\n<h4>v1.06 - November 13, 2015<\\/h4>\\n<ul>\\n<li>Add frmtwlo_format_number filter for formatting the phone number before it\'s sent to Twilio<\\/li>\\n<li>Fix license activation<\\/li>\\n<\\/ul>\\n<h4>v1.05 - October 16, 2015<\\/h4>\\n<ul>\\n<li>Add frmtwlo_sms_response hook for changing the message in the text<\\/li>\\n<li>Allow for 8-digit numbers. +65 phone numbers were having trouble because we assumed they should be US numbers. Now if the number starts with a +, don\'t add the +1<\\/li>\\n<li>Get updates from FormidableForms.com<\\/li>\\n<\\/ul>\\n<h4>v1.04 - September 11, 2015<\\/h4>\\n<ul>\\n<li>Fix error with accepting votes<\\/li>\\n<li>Send a response when a text vote is received<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-twilio\\/formidable-twilio.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"expires\":\"\",\"code\":\"\",\"date\":\"\",\"type\":\"free\"},\"168456\":{\"title\":\"Upload Importer\",\"name\":\"Upload Importer\",\"slug\":\"upload-importer\",\"version\":\"1.0.01\",\"new_version\":\"1.0.01\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-upload-importer\\/formidable-upload-importer-1.0.01.zip\"],\"excerpt\":\"\",\"id\":168456,\"released\":\"2015-10-16 17:05:47\",\"categories\":[\"Strategy11\"],\"docs\":\"\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/upload-importer\\/\",\"changelog\":\"<h4>v1.0.01<\\/h4>\\n<ul>\\n<li>Get updates from FormidablePro.com<\\/li>\\n<\\/ul>\\n<h4>v1.0<\\/h4>\\n<ul>\\n<li>Allow importing of multiple file uploads<\\/li>\\n<li>Replace deprecated mime_content_type with fileinfo<\\/li>\\n<li>Update auto-updating<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"expires\":\"\",\"code\":\"\",\"date\":\"\",\"type\":\"free\"},\"173984\":{\"title\":\"User Registration\",\"name\":\"User Registration\",\"slug\":\"user-registration\",\"version\":\"2.02.02\",\"new_version\":\"2.02.02\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-registration\\/formidable-registration-2.02.02.zip\"],\"excerpt\":\"Give new users access to your site quickly and painlessly. Plus edit profiles and login from the front end.\",\"id\":173984,\"released\":\"2011-12-21 00:00:00\",\"categories\":[\"Business\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/user-registration\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/user-registration\\/\",\"changelog\":\"<h4>v2.02.02 - November 14, 2019<\\/h4>\\n<ul>\\n<li>New: Update for better 4.0 UI and setting layouts.<\\/li>\\n<li>New: Allow rich text fields in registration form action settings.<\\/li>\\n<li>New: Better multilingual support for global messages.<\\/li>\\n<li>New: Added frmreg_global_messages and frmreg_global_pages hooks.<\\/li>\\n<li>Fix: WPML compatibility - Language went back to default language after login.<\\/li>\\n<li>Fix: WPML compatibility - The email confirmation link didn\'t keep the selected language.<\\/li>\\n<li>Fix: Prevent errors when a registration form action is disabled.<\\/li>\\n<li>Fix: API calls were redirected to login page.<\\/li>\\n<li>Fix: Prevent a redirect with the reset password link. If a reset password page was selected in the global settings, the link pointed to the regular WP reset page which redirected.<\\/li>\\n<li>Fix: If custom parameters are included on the login redirect url, keep the correct encoding.<\\/li>\\n<li>Fix: Prevent a + in usernames in order to match WordPress. This was causing issues with auto login and email moderation.<\\/li>\\n<li>Fix: After a user was automatically logged in, wp_get_current_user() in other plugins wasn\'t correct.<\\/li>\\n<\\/ul>\\n<h4>v2.02.01 - September 26, 2018<\\/h4>\\n<ul>\\n<li>Allow user profile updating to be triggered after a successful PayPal payment<\\/li>\\n<li>Fix: Show a blank form to logged in users who have permission to create other users, even if they have an entry in the form<\\/li>\\n<li>New: Added frmreg_allow_edit hook for other plugins to set when profile editing is allowed<\\/li>\\n<\\/ul>\\n<h4>v2.02 - September 14, 2018<\\/h4>\\n<ul>\\n<li>New: Get the page source to check if the page includes the form specified in the global settings (login form, reset password, or registration). This allows for these forms to be included in a sidebar or footer without returning error messages when the global settings are saved.<\\/li>\\n<li>New: Add hooks to change selected pages: frmreg_login_page_id, frmreg_resetpass_page_id, frmreg_register_page_id<\\/li>\\n<li>New: Allow a subsite to be created by a logged in user<\\/li>\\n<li>Fix: Allow user creation via API call<\\/li>\\n<li>Fix: Allow either set password by email or user moderation, but not both<\\/li>\\n<li>Fix: Issue with losing parameters when redirecting for login<\\/li>\\n<li>Fix: The user ID field was defaulting to the current user on registration forms when it should be empty<\\/li>\\n<li>Fix: If an error message is included in the url for password reset, show it instead of an unknown error<\\/li>\\n<li>Fix: Update for WP 3.9 compatibility<\\/li>\\n<li>Fix: Update for deprecated functions: save_settings, FrmForm::get_id_by_key, FrmProFieldsHelper::get_displayed_file_html<\\/li>\\n<li>New: Add Chinese translations<\\/li>\\n<\\/ul>\\n<h4>v2.01.01 - October 26, 2017<\\/h4>\\n<ul>\\n<li>New: Add frmreg_after_create_subsite action.<\\/li>\\n<li>New: Add Norwegian translation.<\\/li>\\n<li>New: Add frmreg_login_error filter.<\\/li>\\n<li>Fix: Make sure show lost password and layout settings apply to widget.<\\/li>\\n<li>Fix: Convert special characters to standard characters in subdomain.<\\/li>\\n<\\/ul>\\n<h4>v2.01 - October 4, 2017<\\/h4>\\n<ul>\\n<li>New: Add global registration page setting.<\\/li>\\n<li>Enhancement: Allow radio and select fields for display name.<\\/li>\\n<li>Enhancement: Change field label in lost password form.<\\/li>\\n<li>Enhancement: Show hidden field type in Subdirectory or Subdomain settings.<\\/li>\\n<li>Enhancement: Always allow administrators to edit profiles through registration form.<\\/li>\\n<li>Enhancement: Redirect to login page if activation link is clicked again after activation.<\\/li>\\n<li>Fix: Show error messages in reset password form.<\\/li>\\n<li>Fix: Set logout label parameter correctly in shortcode builder.<\\/li>\\n<li>Fix: Passwords with special characters not saving as expected.<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-registration\\/formidable-registration.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"expires\":\"\",\"code\":\"\",\"date\":\"\",\"type\":\"free\"},\"170649\":{\"title\":\"User Tracking\",\"name\":\"User Tracking\",\"slug\":\"user-tracking\",\"version\":\"1.0\",\"new_version\":\"1.0\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-user-tracking\\/formidable-user-tracking-1.0.zip\"],\"excerpt\":\"Track which pages a user visits prior to submitting a form.\",\"id\":170649,\"released\":\"2015-10-19 00:00:00\",\"categories\":[\"Creator\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-user-tracking\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/user-tracking\\/\",\"changelog\":\"<h4>v1.0 - August 25, 2016<\\/h4>\\n<ul>\\n<li>Save the tracking info before the email is sent<\\/li>\\n<li>Make sure license key is correct before saving<\\/li>\\n<\\/ul>\\n<h4>v1.0b3<\\/h4>\\n<ul>\\n<li>Get updates from FormidablePro.com<\\/li>\\n<\\/ul>\\n<h4>v1.0b2<\\/h4>\\n<ul>\\n<li>Skip tracking wp-admin\\/ajax.php<\\/li>\\n<li>Remove base url from page list<\\/li>\\n<li>Codestyling to meet WP standards<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-user-tracking\\/formidable-user-tracking.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"expires\":\"\",\"code\":\"\",\"date\":\"\",\"type\":\"free\"},\"174006\":{\"title\":\"WooCommerce\",\"name\":\"WooCommerce\",\"slug\":\"woocommerce\",\"version\":\"1.09\",\"new_version\":\"1.09\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-woocommerce\\/formidable-woocommerce-1.09.zip\"],\"excerpt\":\"Are your WooCommerce product forms too basic? Add custom fields to a product form and collect more data when it is added to the cart.\",\"id\":174006,\"released\":\"2016-01-19 00:00:00\",\"categories\":[\"Ecommerce\",\"Elite\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-woocommerce\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/woocommerce\\/\",\"changelog\":\"\",\"plugin\":\"formidable-woocommerce\\/formidable-woocommerce.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"expires\":\"\",\"code\":\"\",\"date\":\"\",\"type\":\"free\"},\"169998\":{\"title\":\"WP Multilingual\",\"name\":\"WP Multilingual\",\"slug\":\"wp-multilingual\",\"version\":\"1.06\",\"new_version\":\"1.06\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-wpml\\/formidable-wpml-1.06.zip\"],\"excerpt\":\"Translate your forms into multiple languages using the Formidable-integrated WPML plugin.\",\"id\":169998,\"released\":\"2013-04-29 00:00:00\",\"categories\":[\"Business\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-multi-language\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/wp-multilingual\\/\",\"changelog\":\"<h4>v1.04 - October 25th, 2016<\\/h4>\\n<ul>\\n<li>Allow translation of Add\\/Remove buttons<\\/li>\\n<li>Replace some deprecated WPML function calls and constants<\\/li>\\n<li>Make sure wpml strings are updated when form is updated<\\/li>\\n<li>Do not translate default value for all field types<\\/li>\\n<li>Make sure incorrect field message is translated with ajax submit<\\/li>\\n<\\/ul>\\n<h4>v1.03.03 - March 28, 2016<\\/h4>\\n<ul>\\n<li>Send the language in the ajax url differently to prevent 404s during ajax calls. This should help with duplicate submissions.<\\/li>\\n<li>Prevent a license key from being saved for another plugin<\\/li>\\n<\\/ul>\\n<h4>v1.03.02<\\/h4>\\n<ul>\\n<li>Get updates from FormidablePro.com<\\/li>\\n<li>Make it compatible with the free version of Formidable<\\/li>\\n<li>Fix errors when Formidable or WPML are deactivated<\\/li>\\n<li>Include the current language during ajax calls<\\/li>\\n<li>Force an English start language for strings for v2.2.6 of the WPML strings plugin<\\/li>\\n<li>Fix the issue with the default language in WPML being set different than the string language<\\/li>\\n<li>If values in the form settings page changed, update them when going to the translation settings<\\/li>\\n<li>Make sure the \\\"previous\\\" label is translatable when drafts are not enabled<\\/li>\\n<li>Don\'t show strings for inactive languages<\\/li>\\n<li>Translate fields in repeating sections<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-wpml\\/formidable-wpml.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"expires\":\"\",\"code\":\"\",\"date\":\"\",\"type\":\"free\"},\"170645\":{\"title\":\"Zapier\",\"name\":\"Zapier\",\"slug\":\"zapier\",\"version\":\"1.06\",\"new_version\":\"1.06\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-zapier\\/formidable-zapier-1.06.zip\"],\"excerpt\":\"Connect with hundreds of applications through Zapier. Automatically insert a Google spreadsheet row, tweet, or upload to Dropbox.\",\"id\":170645,\"released\":\"2014-06-04 00:00:00\",\"categories\":[\"Business\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-zapier\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/zapier\\/\",\"changelog\":\"<h4>v1.06 - February 6, 2019<\\/h4>\\n<ul>\\n<li>Add a new fallback for authentication with the API key in the url. When the API key continues to say it is missing, add add_filter( \'frm_zap_url_auth\', \'__return_true\' ); in the theme functions.php.<br \\/>\\nThen use this url in Zapier:<br \\/>\\nhttps:\\/\\/yoursite.com\\/API-KEY-GOES-HERE\\/\\n<\\/li>\\n<li>New: Add frm_zap_sent hook to run after an entry is sent to Zapier<\\/li>\\n<li>Fix: Don\'t send draft entries to Zapier<\\/li>\\n<li>Added automation to release new versions<\\/li>\\n<\\/ul>\\n<h4>v1.05 - July 31, 2018<\\/h4>\\n<ul>\\n<li>New: Add frmzap_entry_array filter to customize the entry values sent to Zapier<\\/li>\\n<li>New: Add logging of Zapier responses into the Logs addon<\\/li>\\n<li>Fix: Prevent a blank response when fetching the list of forms. This was happening on some sites with a lot of forms<\\/li>\\n<\\/ul>\\n<h4>v1.04 - July 31, 2017<\\/h4>\\n<p>Fix a conflict with API keys between the Zapier and API addons on a multisite network. This solves the issue with the incorrect API key error message in Zapier.<\\/p>\\n<h4>v1.03 - June 5, 2017<\\/h4>\\n<ul>\\n<li>Allow field ids to be used in Zapier mapping instead of only field keys<\\/li>\\n<li>Increase the limit of triggered zaps per form from 5 to 40<\\/li>\\n<li>Fix overloaded property error when setting the user for authentication<\\/li>\\n<li>Prevent error reporting during API calls so the response is formatted correctly<\\/li>\\n<\\/ul>\\n<h4>v1.02 - November 13, 2015<\\/h4>\\n<ul>\\n<li>Prevent error when Formidable is disabled<\\/li>\\n<li>Use static classes for fields and forms<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-zapier\\/formidable-zapier.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"expires\":\"\",\"code\":\"\",\"date\":\"\",\"type\":\"free\"}}\";s:7:\"version\";s:4:\"4.06\";}', 'no');
